import React, { Component } from 'react'
import SidebarItem from './SidebarItem'

class Sidebar extends Component {

	constructor({ isNodeEditmode, data, node, handleNodeClick}) {
        super();
        this.isNodeEditmode = isNodeEditmode;
        this.data = data;
        this.node = node
        this.handleNodeClick = handleNodeClick
    }

    render() {

    	if (this.isNodeEditmode) {
    		return (
    			<div className="Sidebar">
    				{this.node.id}
    			</div>
    		)
    	} else {

	        return(
	            <div className="Sidebar">
	            	{this.data.nodes.map((node, index) => (
	                    <SidebarItem
	                        key={index}
	                        type={node.type}
	                        ports={node.ports}
	                        properties={node.properties}
	                        handleNodeClick={this.handleNodeClick(node)}
	                    />
	                ))}
	            </div>            
	        )
	    }
    }
}

export default Sidebar
